insert into PRD_BANKFINANCE values (null, '00045573', '“金钥匙·安心得利”2012第1918期“迎国庆·中秋”人民币理财产品', '农业银行', '人民币', '33天', '2012-09-28', '2012-09-27', '2012-09-27', '33天', '3.9', '组合型', '20 万元', '浮动收益型', '全国', '10000', '无', '否', '', '银行有权提前终止，客户不可赎回', '本理财产品资金由资产管理人主要投资于国债、金融债、央行票据、回购、较高信用等级的信用债（包括但不限于企业债、公司债、中期票据、短期融资券、超短期融资券）、交易所债券、非公开定向债务融资工具、可转债、同业存款、同业借款等低风险同业资金业务、通过掉期锁定风险的本、外币货币资金市场工具、投资类信托计划（通过信托计划投资于同业存款、债券等品种）、委托类资产、债权类资产受益权、前期已成立的优质企业信托融资项目，以及其他符合监管要求的投资品种。本理财产品类型非保本浮动收益型，产品适合风险承受能力为谨慎型、稳健型、进取型和激进型的投资者', '扣除各项费用后，认购金额在20万元以上预期最高年化收益率3.90%',0, null,'2012-09-27 11:38:15.149304');
insert into PRD_BANKFINANCE values (null, '00045574', '“金钥匙·安心得利”2012第1919期“迎国庆·中秋”人民币理财产品', '农业银行', '人民币', '47天', '2012-09-28', '2012-09-27', '2012-09-27', '47天', '3.95', '组合型', '20 万元', '浮动收益型', '全国', '10000', '无', '否', '', '银行有权提前终止，客户不可赎回', '本理财产品资金由资产管理人主要投资于国债、金融债、央行票据、回购、较高信用等级的信用债（包括但不限于企业债、公司债、中期票据、短期融资券、超短期融资券）、交易所债券、非公开定向债务融资工具、可转债、同业存款、同业借款等低风险同业资金业务、通过掉期锁定风险的本、外币货币资金市场工具、投资类信托计划（通过信托计划投资于同业存款、债券等品种）、委托类资产、债权类资产受益权、前期已成立的优质企业信托融资项目，以及其他符合监管要求的投资品种。本理财产品类型非保本浮动收益型，产品适合风险承受能力为谨慎型、稳健型、进取型和激进型的投资者', '扣除各项费用后，认购金额在20万元以上预期最高年化收益率3.85%',0, null,'2012-09-27 11:38:15.509377');
insert into PRD_BANKFINANCE values (null, '00045831', '2012年第067期“工银财富”专属资产组合投资型人民币36天产品JSXT2067', '工商银行', '人民币', '36天', '2012-10-08', '2012-09-27', '2012-10-07', '36天', '4.5', '组合型', '5 万元', '浮动收益型', '江苏', '1000', '预期年率已扣除相关费用，理财资产运作超过最高年化收益率的部分作为银行投资管理费用。', '否', '', '1.工商银行有权按照产品实际投资情况提前终止该产品。2.客户无权提前终止该产品。', '该产品主要投资于银行间债券市场发行的各类债券、货币市场基金、债券基金、存款等货币市场投资工具以及符合监管机构要求的债权类资产、权益类资产、其他资产或资产组合。本期产品所投资的资产或资产组合均严格经过工行审批流程审批和筛选，在期初投资时达到可投资标准，资产或资产组合所涉及用款人比照工行评级标准均在A-级（含）以上，若涉及信贷资产按五级分类均为正常类；拟投资的各类债券主体评级均达到AA级（含）以上。该产品为非保本浮动收益型，投资者面临所投资的资产或资产组合涉及的用款人和债券发行人的信用违约。若出现上述情况，投资者将面临投资本金和收益遭受损失的风险。经工商银行风险评估，风险等级为PR2（较低风险水平），适合评定为稳健型、平衡型、成长型、进取型的投资者。', '按目前各类资产的市场收益率水平计算，该资产组合预期年化收益率扣除工商银行理财销售费、托管费等费用，产品到期后，若所投资的资产按时收回全额资金，则客户可获得的预期最高年化收益率为4.50%。',0, null,'2012-09-27 11:38:15.853657');
