insert into PRD_BANKFINANCE values (null, '00045882', '2012年“珠联璧合（1207期保本5）”人民币理财产品A79005', '南京银行', '人民币', '91天', '2012-09-28', '2012-09-26', '2012-09-27', '91天', '3.9', '票据型', '5 万元', '固定收益型', '全国', '10000', '销售费：本产品按募集本金余额收取年化0.2%的销售费。', '否', '', '在理财期限内，客户无提前终止权，银行根据投资情况有提前终止权。', '本理财产品对国债、央行票据、金融债、AAA级的企业债、中期票据、A-1级的短期融资券以及同业存款、回购、拆借、等资产的投资比例不低于30%，AAA级以下的企业债、中期票据等资产的投资比例不高于70%。', '银行保证客户实现',0, null,'2012-09-27 11:38:20.090832');
insert into PRD_BANKFINANCE values (null, '00045893', '2012年第86期财富债券人民币理财产品(1200012C86)', '中国邮政储蓄银行', '人民币', '182天', '2012-09-28', '2012-09-26', '2012-09-27', '182天', '4.4', '信托类', '5 万元', '浮动收益型', '全国', '10000', '银行保管费0.05%年', '否', '', '1.投资者无权提前终止该产品。2.银行有权按照项目投资实际情况，提前终止该产品。', '本产品募集资金将100%投资于上述信托计划。本期产品投资方向为邮储银行（委托人）委托陕西省国际信托股份有限公司（受托人）设立的陕国投财富资金信托计划，信托资金主要投资于我国银行间市场债券资产、银行存款以及其他固定收益类金融资产。', '预期最高年化收益率4.40%。',0, null,'2012-09-27 11:38:20.916618');
insert into PRD_BANKFINANCE values (null, '00045899', '中银集富专享系列2012年第113期（47天）产品', '中国银行', '人民币', '47天', '2012-09-28', '2012-09-26', '2012-09-27', '47天', '4.0', '组合型', '10 万元', '浮动收益型', '全国', '1000', '无', '否', '', '1、银行有权提前终止。2、投资者无权提前终止。', '本理财计划主要投资于优质企业债权资产、银行存款、债券等金融产品。其中投资于优质企业债权资产的比例将为理财资金的90%，投资于银行存款、债券等高流动性资产的比例将为理财资金的10%。投资比例可在[-10%,+10%]的区间内浮动。产品为非保本浮动收益型，该产品经中国银行风险评级为中等风险产品，即本金亏损的概率较低，预期收益存在一定的不确定性。流动性评级为中。该产品适合平衡型、成长型和进取型的投资者。中国银行认为合格的个人投资者为满足如下四个条件之一的投资者：（1）单笔投资最低金额不少于100万元人民币的自然人；（2）个人或家庭金融资产总计在其认购时超过100万元人民币，且能提供相关财产证明的自然人；（3）个人收入在最近三年内每年收入超过20万元或者夫妻双方合计收入在最近三年内每年收入超过30万元人民币，且能提供相关财产证明的自然人；（4）我行财富中心或私人银行签约客户。', '本产品持有到期的预期年投资收益率为4.0％。',0, null,'2012-09-27 11:38:21.483417');
insert into PRD_BANKFINANCE values (null, '00045900', '中银稳富ZJGT2012006人民币133天理财产品', '中国银行', '人民币', '133天', '2012-10-10', '2012-09-26', '2012-10-09', '133天', '4.1', '组合型', '10 万元', '浮动收益型', '浙江', '1000', '无', '否', '', '银行可提前终止，投资者不可提前赎回。', '本产品系列募集资金主要通过单一信托或券商定向资产管理计划投资于债券、货币市场工具以及其它低风险的投资品种，其中债券包括但不限于在交易所/银行间的国债、中央银行票据、企业债券、公司债券、各类金融债、可转换债券、银行间市场交易商协会注册发行的各类债务融资工具，货币市场工具包括但不限于现金、银行存款、大额可转让存单（CD）、短期债券逆回购等，其它低风险的投资品种包括但不限于固定收益品种的信托计划等。上述债券类品种投资比例为70-100%，货币市场工具投资比例为0-10%，其他低风险类投资品种投资比例为0-40%。 该产品为非保本浮动收益型，投资者主要面临信用风险：如果本产品所投资的各项金融工具本息未能完全如期收回，本产品的收益率可能低于预期最高收益率，收益可能为0，甚至发生本金损失。中行对该产品的风险评级为中等风险，流动性评级为中，该产品适合评定为有投资经验的平衡型、成长型、进取型的投资者。', '该产品预期年收益率为4.10%。',0, null,'2012-09-27 11:38:21.824531');
insert into PRD_BANKFINANCE values (null, '00045905', '“中银集富理财（178天）”2012年第187期人民币178天产品', '中国银行', '人民币', '178天', '2012-09-29', '2012-09-26', '2012-09-29', '178天', '4.6', '组合型', '10 万元', '浮动收益型', '上海', '1000', '超过预期年投资收益率的收益作为理财计划管理人的产品管理费。', '否', '', '1、银行有权提前终止。2、投资者无权提前终止。', '该理财计划主要主要投资于票据收益权、应收账款、国内信用证、银行存款、同业存放、国债、银行间市场交易的债券、公司债等金融产品。其中投资于票据收益权、应收账款和国内信用证的比例将不低于理财资金的90%，投资于银行存款、同业存放、国债、银行间市场交易的债券、公司债等高流动性资产的比例将不高于10%。 产品为非保本浮动收益型，产品经中国银行风险评级为中等风险产品，即本金亏损的概率较低，预期收益存在一定的不确定性。流动性评级为中。该产品适合平衡型、成长型和进取型的投资者。', '该产品预期年化收益率为4.60%。',0, null,'2012-09-27 11:38:22.216951');
insert into PRD_BANKFINANCE values (null, '00045907', 'QDII之“挂钩一篮子股票”人民币1年期保本投资产品(9.26-10.16)', '花旗银行', '人民币', '1年', '2012-10-20', '2012-09-26', '2012-10-16', '1年', '6.0', 'QDII型', '5 万元', '浮动收益型', '全国', '10000', '无', '否', '', '一般情况下，银行和投资者均不可提前终止该产品。', '产品的收益挂钩一篮子股票。即：谷歌公司（彭博代码：GOOG UQ）、百度公司（彭博代码：BIDU UQ）和腾讯公司（彭博代码：700 HK）。产品特色：（1）捕捉国际级互联网服务提供商之成长潜力：本产品潜在投资收益与谷歌公司、百度公司和腾讯公司的上市股票表现挂钩，这3家公司在互联网产业发展中分别占据一席之地，且具有较强的成长潜力。本产品可能适合熟悉挂钩股票并看好其未来发展的投资者。（2）最低收益率有保证，潜在最高收益率为6%：如果在产品观测期内触发事件发生，则产品到期投资收益率为6%，投资者有机会获得可能高于花旗银行同期人民币普通定期存款利息投资收益。反之，若触发事件未发生，则产品到期最低投资收益率为0.5%。（3）本金保障，安心理财：投资者持有本产品至期满，即在产品到期前没有任何提前支取或终止行为，即可获得本金100% 本金保障，理财更安心。本产品为保本浮动收益型理财产品，具有投资风险，只保障理财资金本金，不保证理财收益。适合看好这三支股票的稳健型投资者。', '产品收益：如果在产品观测期内触发事件发生，则产品到期投资收益率为6%，投资者有机会获得可能高于花旗银行同期人民币普通定期存款利息投资收益。反之，若触发事件未发生，则产品到期最低投资收益率为0.5%。',0, null,'2012-09-27 11:38:22.573976');
insert into PRD_BANKFINANCE values (null, '00045677', '“鑫意”理财恒通2012第六十五期人民币理财产品', '上海农商银行', '人民币', '65天', '2012-09-29', '2012-09-26', '2012-09-28', '65天', '4.0', '票据型', '5 万元', '固定收益型', '全国', '1000', '理财产品到期年化收益率高于4.00%，则以上部分作为银行管理费用。', '否', '', '1.银行有权提前终止本理财产品。2.投资者无权提前终止该产品。', '本理财产品将主要投资于投资级以上债券资产、货币市场金融资产和金融工具、固定收益类信托计划。产品所投资的信托计划投资范围主要为在银行间市场公开发行和上市流通的债券、货币市场工具等，其中，债券发行人的外部主体评级为AA-（含）以上，债项评级为AA-（含）以上或A-1。此外，本理财产品也可投资于银行间市场其他符合监管要求的金融资产和金融工具等。 该产品为保本保证收益型，本金安全，收益稳定。上海农村商业银行对该产品的内部风险评级为：低风险产品。该产品适合评定为保守型、稳健型、平衡型、成长型、进取型的投资者。', '该理财产品经组合测算，扣除产品托管费用和交易费用后，投资者持有到期年化收益率为4.00%。',0, null,'2012-09-27 11:38:23.536420');
insert into PRD_BANKFINANCE values (null, '00045691', '“聚财宝”周添利3号人民币理财产品(9.26-9.27)', '平安银行', '人民币', '7天', '2012-09-28', '2012-09-26', '2012-09-27', '7天', '3.6', '票据型', '5 万元', '浮动收益型', '全国', '1000', '超过预期最高年化收益率的收益部分作为深圳发展银行的手续费。', '否', '', '1.平安银行对本产品保留：根据市场情况选择在理财期内任一天提前终止产品的权利，以及在产品到期日延期结束产品的权利。2.理财期内，投资者无提前终止本理财计划的权利。', '本理财产品募集的资金投资于银行间债券市场信用等级较高债券和货币市场工具。该产品为保本浮动收益型，经平安银行风险承受度评估，该产品适合于评定为“激进型”、“进取型”、“平衡型”、“稳健型”、“谨慎型”的客户。', '根据当期可投资资产收益率，扣除产品的成本，本期理财产品预期最高年化收益率为3.60 %。',0, null,'2012-09-27 11:38:24.649670');
insert into PRD_BANKFINANCE values (null, '00045692', '“聚财宝”双周利人民币理财产品(9.26-9.27)', '平安银行', '人民币', '14天', '2012-09-28', '2012-09-26', '2012-09-27', '14天', '3.65', '票据型', '5 万元', '浮动收益型', '全国', '1000', '超过预期最高年化收益率的收益部分作为深圳发展银行的手续费。', '否', '', '1.平安银行对本产品保留：根据市场情况选择在理财期内任一天提前终止产品的权利，以及在产品到期日延期结束产品的权利。2.理财期内，投资者无提前终止本理财计划的权利。', '本理财产品募集的资金投资于银行间债券市场信用等级较高债券和货币市场工具。该产品为保本浮动收益型，经平安银行风险承受度评估，该产品适合于评定为“激进型”、“进取型”、“平衡型”、“稳健型”、“谨慎型”的客户。', '根据当期可投资资产收益率，扣除产品的成本，本期理财产品预期最高年化收益率为3.65 %。',0, null,'2012-09-27 11:38:26.560031');
insert into PRD_BANKFINANCE values (null, '00045898', '2012年“金葵花”-招银进宝之点贷成金1017号理财计划101897', '招商银行', '人民币', '75天', '2012-10-15', '2012-10-10', '2012-10-14', '75天', '4.3', '组合型', '5 万元', '浮动收益型', '青岛,长沙', '10000', '无', '否', '', '银行有权提前终止，投资者无提前终止权。', '本理财计划投资于AA级(含)以上信用级别高,流动性好的银行间市场流通债券，信托计划，银行存款等其他金融资产。投资比例区间：债券资产、银行存款：30%—100% ；其他资产不高于70%。', '预期年化收益率为4.30%',0, null,'2012-09-27 11:38:27.735902');
insert into PRD_BANKFINANCE values (null, '00045849', '“锦程盈利”2012年22号人民币61天理财产品', '成都银行', '人民币', '61天', '2012-10-17', '2012-10-10', '2012-10-16', '61天', '4.6', '票据型', '5 万元', '浮动收益型', '全国', '10000', '预期年率已扣除相关费用。', '否', '', '1.客户无提前终止权。2.当银行认定市场变化不利于本理财产品运作的情况出现时，银行可提前结束理财产品。', '该产品募集资金对商业银行担保或作为还款人的有价证券或债权（务）协议投资比例不低于90%。该产品为非保本浮动收益型，投资者主要面临信用风险：如果基础资产发行人无法按时足额支付本金和收益，投资者收益甚至本金可能受到损失。该产品适合稳健型、平衡型、进取型、成长型投资者。', '产品预期年收益率为4.60%。',0, null,'2012-09-27 11:38:28.481319');
insert into PRD_BANKFINANCE values (null, '00045896', '2012年“金葵花”-招银进宝之点贷成金1015号理财计划101895', '招商银行', '人民币', '78天', '2012-10-12', '2012-10-08', '2012-10-11', '78天', '4.3', '组合型', '5 万元', '浮动收益型', '福州,厦门', '10000', '无', '否', '', '银行有权提前终止，投资者无提前终止权。', '本理财计划投资于AA级(含)以上信用级别高,流动性好的银行间市场流通债券，信托计划，银行存款等其他金融资产。投资比例区间：债券资产、银行存款：30%—100% ；其他资产不高于70%。', '预期年化收益率为4.30%',0, null,'2012-09-27 11:38:29.210852');
insert into PRD_BANKFINANCE values (null, '00045897', '2012年“金葵花”-招银进宝之点贷成金1016号理财计划101896', '招商银行', '人民币', '45天', '2012-10-12', '2012-10-08', '2012-10-11', '45天', '4.2', '组合型', '10 万元', '浮动收益型', '福州,哈尔滨', '10000', '无', '否', '', '银行有权提前终止，投资者无提前终止权。', '本理财计划投资于AA级(含)以上信用级别高,流动性好的银行间市场流通债券，信托计划，银行存款等其他金融资产。投资比例区间：债券资产、银行存款：30%—100% ；其他资产不高于70%。', '预期年化收益率为4.20%',0, null,'2012-09-27 11:38:29.776779');
insert into PRD_BANKFINANCE values (null, '00045856', '“鑫意”理财福通2012第117期人民币理财产品', '上海农商银行', '人民币', '90天', '2012-10-12', '2012-10-08', '2012-10-11', '90天', '4.4', '票据型', '5 万元', '浮动收益型', '全国', '10000', '预期最高年率已扣除相关费用；实际年化收益率高于4.40%以上部分作为银行管理费用。', '否', '', '1.银行有权提前终止该产品。2.投资者无权提前终止本理财产品，若提前终止则视为违约。', '本理财产品将主要投资于投资级以上债券资产、货币市场金融资产和金融工具、固定收益类信托计划。产品所投资的信托计划投资范围主要为在银行间市场公开发行和上市流通的债券、货币市场工具等，其中，债券发行人的外部主体评级为AA-（含）以上，债项评级为AA-（含）以上或A-1。此外，本理财产品也可投资于银行间市场其他符合监管要求的金融资产和金融工具等。该产品为非保本浮动收益型，上海农村商业银行对该产品的内部风险评级为：中低风险产品。经上海农村商业银行客户风险承受能力评估，该产品适合稳健型、平衡型、成长型、进取型的投资者。', '该理财产品经组合测算，到期后如所投资金融资产可顺利处置，扣除产品托管费用0.05%和交易费用0.01%后，产品预期最高年化收益率为4.40%。',0, null,'2012-09-27 11:38:30.367330');
insert into PRD_BANKFINANCE values (null, '00045857', '“鑫意”理财福通2012第116期人民币理财产品（专属）', '上海农商银行', '人民币', '59天', '2012-10-12', '2012-10-08', '2012-10-11', '59天', '4.3', '票据型', '5 万元', '浮动收益型', '全国', '10000', '预期最高年率已扣除相关费用；实际年化收益率高于4.30%以上部分作为银行管理费用。', '否', '', '1.银行有权提前终止该产品。2.投资者无权提前终止本理财产品，若提前终止则视为违约。', '本款理财产品仅向我行金融便利店客户提供，产品将主要投资于投资级以上债券资产、货币市场金融资产和金融工具、固定收益类信托计划。产品所投资的信托计划投资范围主要为在银行间市场公开发行和上市流通的债券、货币市场工具等，其中，债券发行人的外部主体评级为AA-（含）以上，债项评级为AA-（含）以上或A-1。此外，本理财产品也可投资于银行间市场其他符合监管要求的金融资产和金融工具等。该产品为非保本浮动收益型，上海农村商业银行对该产品的内部风险评级为：中低风险产品。经上海农村商业银行客户风险承受能力评估，该产品适合稳健型、平衡型、成长型、进取型的投资者。', '该理财产品经组合测算，到期后如所投资金融资产可顺利处置，扣除产品托管费用0.05%和交易费用0.01%后，产品预期最高年化收益率为4.30%。',0, null,'2012-09-27 11:38:33.188616');
insert into PRD_BANKFINANCE values (null, '00045519', '“金钥匙·本利丰”2012年第268期人民币理财产品', '农业银行', '人民币', '35天', '2012-10-08', '2012-10-06', '2012-10-07', '35天', '3.2', '组合型', '5 万元', '固定收益型', '全国', '10000', '托管费：0.05%/年，由托管人按日收取。管理费：0.20%/年。无认购费、申购费、赎回费。', '否', '', '银行有权提前终止，客户不可赎回', '本理财产品资金由资产管理人主要投资于国债、金融债、央行票据、回购、高信用等级的信用债、委托类资产、前期已成立的优质企业信托融资项目，投资类信托计划（通过信托计划投资于同业存款、债券等品种），以及其他符合监管要求的投资品种。本理财产品类型为保本保证收益型，产品适合风险承受能力为保守型、谨慎型、稳健型、进取型和激进型的投资者', '预期最高年化收益率（扣除各项费用后）3.20%',0, null,'2012-09-27 11:38:34.647879');
