/*!40101 SET NAMES utf8 */;insert into PRD_BANKFINANCE values (null, '00045827', '“聚财宝”周末发2012年112号人民币理财产品', '平安银行', '人民币', '9天', '2012-09-29', '2012-09-27', '2012-09-29', '9天', '2.95', '票据型', '5 万元', '浮动收益型', '全国', '1000', '超过预期最高年化收益率的收益部分作为深圳发展银行的手续费。', '否', '', '1.银行可根据市场情况到期终止或者提前终止本理财产品。2.投资者无权提前终止理财但可提前预约到期支取。', '本理财产品募集的资金投资于银行间市场信用等级较高、流动性较好的债券或货币市场工具，包括：债券回购、拆借、央行票据、国债、金融债、以及高信用级别的企业债券（企业债、公司债、短期融资券、中期票据等）等资产。 该产品为保本浮动收益型，期限短，流动性好，经深圳发展银行风险承受度评估，适合评定为“激进型”、“进取型”、“平衡型”、“稳健型”、“谨慎型”的客户。', '根据当期可投资资产收益率，扣除产品的成本，本期理财产品预期最高年化收益率为2.95%。',0, null,'2012-09-27 11:38:14.786096');
